 import React from 'react';
 
 var nodeitems = [{id:1,name:'ברי',placex:100,placey:100},{id:2,name:'שמא',placex:300,placey:100},{id:3,name:'חזקת ממון',placex:200,placey:100},{id:4,name:'חזקת הגוף',placex:400,placey:100},{id:5,name:'ברי חזקת ממון',placex:150,placey:200},{id:6,name:'שמא חזקת הגוף',placex:150,placey:200}];
 var architems = [{name:'ביחד',from:1,to:3},{name:'ביחד',from:2,to:4},{name:'גובר',from:1,to:3}];
 const Roundnode = (props) => {
    return (<div style={{backgroundColor:red,position:absolute,width:'60px',top:props.placex,left:props.placey}}>
        <div style={{backgroundColor:white,position:absolute,width:'40px',top:(props.placex+20)+'px',left:(props.placey+20)+'px'}}>
            <div style={{backgroundColor:red,position:absolute,width:'20px',top:(props.placex+40)+'px',left:(props.placey+40)+'px'}}></div>
        </div>
    </div>);
    
    
}
 const Backgrnd = () =>{
    {nodeitems.map((item, index) => (
        <Roundnode placex={item.placex} placey={item.placey} />
      ))}
    return (<Roundnode placex/>);
 }
 export default Backgrnd;
